import React from 'react';
import { FC } from 'react'
import '../../css/auth.css'

export const Register : FC =() =>{
    return (
        <div className="authorize">
            <h1>WebShell</h1>
            <label>Логин</label> <p/>
            <input /><p/>
            <label>Пароль</label><p/>
            <input /><p/>
            <button className='buttonAuth'>Зарегестрироваться</button>
        </div>
    );
}
